import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter } from "react-router-dom";

import "./index.css";
import App from "./App";
import MainNavigation from "./components/layout/MainNavigation";

ReactDOM.render(
  <BrowserRouter>
    <MainNavigation>
      <App />
    </MainNavigation>
  </BrowserRouter>,
  document.getElementById("root")
);
